import React from "react";
import "./styles/navbar.css";

export default function Navbar() {
  return (
    <nav>
      <div className="top-nav">
        <div className="logo">
          <h2>Tenzor</h2>
          {/* <img src="../images/" alt="" /> */}
        </div>
        <ul>
          <li>Home</li>
          <li>Products</li>
          <li>Account</li>
          <li>
            Upload &nbsp;<i class="fa-solid fa-arrow-up-from-bracket fa-sm"></i>
          </li>
          <li>Contact us</li>
        </ul>
      </div>
      <div className="bottom-nav">
        <input type="text" />
      </div>
    </nav>
  );
}
